import React, { useState } from "react";
import TextField from "@mui/material/TextField";
import Grid from "@mui/material/Grid";
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";
import CountrySelect from "./components/CountrySelect";
import SignupModal from "./components/SignupModal";

const initialSendData = {
    email: "",
    password: "",
    repeatPassword: "",
    name: "",
    hospital: "",
    tel: "",
    country: "",
    term_check: false,
};

const Loading = () => {
    const [emailErrors, setEmailErrors] = useState(true);
    const [passwordErrors, setPasswordErrors] = useState(true);
    const [nameErrors, setNameErrors] = useState(true);
    const [repeatPasswordErrors, setRepeatPasswordErrors] = useState(true);
    const [telErrors, setTelErrors] = useState(true);
    const [hospitalErrors, setHospitalErrors] = useState(true);
    const [termErrors, setTermErrors] = useState(true);
    const [isSuccess, setIsSuccess] = useState(false);

    const validateCredentials = () => {
        // Implement your logic to validate email and password.
        // Assume successful validation and set isSuccess to true.
        setIsSuccess(true);
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        validateCredentials();
    };

    const [sendData, setSendData] = useState(initialSendData); // 초기 상태로 설정

    const checkName = (e) => {
        var nameRegExp = /^[가-힣a-zA-Z]+$/;
        setNameErrors(!nameRegExp.test(e.target.value));
    };

    const checkEmail = (e) => {
        var emailRegExp =
            /^[A-Za-z0-9]([-_.]?[A-Za-z0-9])*@[A-Za-z0-9]([-_.]?[A-Za-z0-9])*\.[A-Za-z]{2,3}$/;
        setEmailErrors(!emailRegExp.test(e.target.value));
    };

    const checkPassword = (e) => {
        var passwordRegExp =
            /^(?=.*[!@#$%^&*(),.?":{}|<>])(?=.*[0-9])(?=.*[a-zA-Z]).{8,}$/;
        setPasswordErrors(!passwordRegExp.test(e.target.value));
    };

    const checkRepeatPassword = (e) => {
        var repeatPasswordRegExp =
            /^(?=.*[!@#$%^&*(),.?":{}|<>])(?=.*[0-9])(?=.*[a-zA-Z]).{8,}$/;
        if (repeatPasswordRegExp.test(e.target.value)) {
            setRepeatPasswordErrors(false);
        } else if (
            sendData.password !== sendData.repeatPassword ||
            sendData.repeatPassword === ""
        ) {
            setRepeatPasswordErrors(true);
        }
    };

    const checkTel = (e) => {
        var telRegExp = /^[0-9]{2,3}[0-9]{3,4}[0-9]{4}/;
        setTelErrors(!telRegExp.test(e.target.value));
    };

    const checkHospital = (e) => {
        if (e.target.value === "") {
            setHospitalErrors(true);
        } else {
            setHospitalErrors(false);
        }
    };

    const checkTerm = (e) => {
        if (e.target.checked === false) {
            setTermErrors(true);
        } else {
            setTermErrors(false);
        }
    };

    const onchange = (e) => {
        setSendData({
            ...sendData,
            [e.target.name]: e.target.value,
        });
    };

    return (
        <div className="SignUp">
            <div>
                <div className="head">
                    <h2>Sign Up</h2>
                    <h5>Purgo e-CRF System</h5>
                </div>
                <form onSubmit={handleSubmit}>
                    <div className="signup_name_texfield">
                        <TextField
                            value={sendData.name}
                            label="Name"
                            required
                            name="name"
                            margin="normal"
                            color="secondary"
                            fullWidth
                            autoFocus
                            error={nameErrors && sendData.name !== ""}
                            onChange={(e) => {
                                onchange(e);
                                checkName(e);
                            }}
                            helperText={
                                nameErrors && sendData.name !== ""
                                    ? "Correct name is required"
                                    : null
                            }
                        />
                    </div>
                    <div className="signup_email_textfield">
                        <TextField
                            value={sendData.email}
                            label="Email"
                            required
                            name="email"
                            autoComplete="email"
                            margin="normal"
                            color="secondary"
                            fullWidth
                            error={emailErrors && sendData.email !== ""}
                            onChange={(e) => {
                                onchange(e);
                                checkEmail(e);
                            }}
                            helperText={
                                emailErrors && sendData.email !== ""
                                    ? "Correct email is required"
                                    : null
                            }
                        />
                    </div>
                    <div className="signup_password_textfield">
                        <TextField
                            value={sendData.password}
                            label="Password"
                            type="password"
                            required
                            name="password"
                            autoComplete="current-password"
                            margin="normal"
                            color="secondary"
                            fullWidth
                            error={passwordErrors && sendData.password !== ""}
                            onChange={(e) => {
                                onchange(e);
                                checkPassword(e);
                            }}
                            helperText={
                                passwordErrors && sendData.password !== ""
                                    ? "Correct password is required"
                                    : null
                            }
                        />
                    </div>
                    <div className="signup_repeat_password_textfield">
                        <TextField
                            value={sendData.repeatPassword}
                            label="repeatPassword"
                            required
                            type="password"
                            name="repeatPassword"
                            margin="normal"
                            color="secondary"
                            fullWidth
                            error={
                                repeatPasswordErrors &&
                                sendData.repeatPassword !== ""
                            }
                            onChange={(e) => {
                                onchange(e);
                                checkRepeatPassword(e);
                            }}
                            helperText={
                                repeatPasswordErrors &&
                                sendData.repeatPassword !== ""
                                    ? "Correct password is required"
                                    : null
                            }
                        />
                    </div>
                    <div className="signup_tel_number_textfield">
                        <TextField
                            value={sendData.tel}
                            label="tel"
                            type="tel"
                            required
                            name="tel"
                            margin="normal"
                            color="secondary"
                            fullWidth
                            error={telErrors && sendData.tel !== ""}
                            onChange={(e) => {
                                onchange(e);
                                checkTel(e);
                            }}
                            helperText={
                                telErrors && sendData.tel !== ""
                                    ? "Correct phone number is required"
                                    : null
                            }
                        />
                    </div>
                    <div className="signup_hospital_name_textfield">
                        <TextField
                            value={sendData.hospital}
                            label="Name of clinic / Hospital"
                            required
                            name="hospital"
                            margin="normal"
                            color="secondary"
                            fullWidth
                            error={hospitalErrors && sendData.hospital !== ""}
                            helperText={
                                hospitalErrors && sendData.hospital !== ""
                                    ? "Correct hospital name is required"
                                    : null
                            }
                            onChange={(e) => {
                                onchange(e);
                                checkHospital(e);
                            }}
                        />
                    </div>
                    <div className="CountrySelect">
                        <CountrySelect
                            fullWidth
                            margin="normal"
                            value={sendData.country}
                            name="country"
                            setSendData={setSendData}
                        />
                    </div>
                    <div className="Term_check">
                        <input
                            name="term_check"
                            value={sendData.term_check}
                            type="checkbox"
                            onClick={(e) => {
                                setSendData({
                                    ...sendData,
                                    [e.target.name]: e.target.checked,
                                });
                                checkTerm(e);
                            }}
                        />
                        I agree to the{" "}
                        <Link to="/Term" target={"_blank"}>
                            terms and condtions
                        </Link>
                    </div>
                    <SignupModal
                        isSuccess={isSuccess}
                        isError={
                            !emailErrors &&
                            !nameErrors &&
                            !passwordErrors &&
                            !repeatPasswordErrors &&
                            !telErrors &&
                            !hospitalErrors &&
                            !termErrors
                        }
                        validateCredentials={validateCredentials}
                        handleClose={() => setIsSuccess(false)}
                        sendData={sendData}
                    />
                    <Button
                        className="submit_button"
                        type="submit"
                        fullWidth
                        variant="contained"
                        color="secondary"
                        sx={{ mt: 3, mb: 2 }}
                    >
                        Join
                    </Button>
                </form>
                <Grid className="signup_link">
                    Already have a account? <Link to="/">Sign in</Link>{" "}
                </Grid>
                <footer className="footer">
                    Contact Us : 070-4827-1572 / ecrf@purgobio.com
                </footer>
            </div>
        </div>
    );
};

export default Loading;
